import HtmlRoundedIcon from '@mui/icons-material/HtmlRounded';
import CssRoundedIcon from '@mui/icons-material/CssRounded';
import JavascriptRoundedIcon from '@mui/icons-material/JavascriptRounded';
import TerminalTwoToneIcon from '@mui/icons-material/TerminalTwoTone';
import DesignServicesTwoToneIcon from '@mui/icons-material/DesignServicesTwoTone';

const Services = () => {

    return (
        <div className="flex flex-col">
            <div className="pb-4 text-center font-medium text-xl">Here's what I <span>LOVE</span> to do!</div>

            <div className="grid md:grid-cols-2 gap-4">

                <div className="p-4 shadow hover:shadow-md rounded-md flex flex-col bg-accent">
                    <DesignServicesTwoToneIcon className='text-secondary' />
                    <p className='text-secondary/80 font-medium'>Frontend Development</p>
                    <p className='text-sm px-4 text-balance'>
                        I love  crafting captivating user interfaces, bringing designs to life with code, and creating seamless interactive experiences that engage and inspire users.
                    </p>
                </div>

                <div className="p-4 shadow hover:shadow-md rounded-md flex flex-col bg-accent">
                    <TerminalTwoToneIcon className='text-secondary' />
                    <p className='text-secondary/80 font-medium'>Backend Development</p>
                    <p className='text-sm px-4 text-balance'>
                        I'm passionate about architecting systems, optimizing performance, and delving into databases and algorithms. Building scalable solutions and tackling intricate challenges truly energizes my work in backend development.
                    </p>

                </div>

            </div>

            <div className='p-4 shadow hover:shadow-md rounded-md flex flex-col bg-accent mt-4'>
                <p>TECHNO</p>
                vscode
                github
                xampp
                figma
                framer
                webflow
            </div>
        </div>
    );
};

export default Services;
